import React from 'react';


function NavBar() {
    const handleClick = () => {
        // Lógica do clique do botão, se necessário
    };

    return (
        <nav>
            <div className="logo">
                <Link to="/">MangaKu</Link>
            </div>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/lista">Lista</Link></li>
                <li><button className="loginbtn" id="toggleButton" style={{ width: 'auto' }}>Cadastro/Login</button></li>
            </ul>
            <div className="menu-icon">
                <img src={process.env.PUBLIC_URL + '/assets/icon.png'} alt="" />
            </div>
        </nav>
    );
}

export default NavBar;
